$(document).ready(function(){ko.applyBindings(ViewModel);$("#userName").focus()});$("#btnLogin").click(function(){if($("#frmLogin").valid()){$("#btnLogin").attr("disabled",!0);var n=ko.toJS(ViewModel),t=JSON.stringify(n);$.ajax({url:"/umbraco/surface/authentication/loginuser/",cache:!1,type:"POST",contentType:"application/json",data:t,success:function(){LoggedIn()},error:function(n){window.alert("ErrorStatus "+n.status+"  StatusText "+n.statusText);$("#btnLogin").attr("disabled",!1)}})}});